import React, { Component } from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';


class Dashboard extends Component {
    render() {
        return (
            <Row className="mt-2">
                <Col>
                    <h1>Hellow</h1>

                </Col>
            </Row>
        )
    }
}

export default Dashboard;
